import React from "react";

const Dashboard = () => {
  return (
    <>
      <div className="bg-orange-100 min-h-screen">
        <div className="pt-5 flex justify-center items-center">
          <h1 className="text-4xl font-bold text-blue-600">Dashboard</h1>
        </div>{" "}
        <div className="flex flex-row  items-center justify-center pt-5">
          <div className="grid justify-center  items-center grid-cols-4 gap-4">
            <div
              className="bg-no-repeat bg-orange-200 border border-orange-300 rounded-xl w-5/12 ml-2 p-6"
              style={{
                width: "100%"
              }}
            >
              <p className="text-5xl text-indigo-900">
                Form 1 <br />
              </p>
            </div>
            <div
              className="bg-no-repeat bg-orange-200 border border-orange-300 rounded-xl w-5/12 ml-2 p-6"
              style={{
                width: "200 px", height: "200 px"
              }}
            >
              <p className="text-5xl text-indigo-900">
              Form 2 <br />
              </p>
            </div>
            <div
              className="bg-no-repeat bg-orange-200 border border-orange-300 rounded-xl w-5/12 ml-2 p-6"
              style={{
                width: "100%"
              }}
            >
              <p className="text-5xl text-indigo-900">
              Form 3 <br />
                
              </p>
            </div>
            <div
              className="bg-no-repeat bg-orange-200 border border-orange-300 rounded-xl w-5/12 ml-2 p-6"
              style={{
                width: "100%"
              }}
            >
              <p className="text-5xl text-indigo-900">
              Form 4 <br />
                
              </p>
            </div>
            <div
              className="bg-no-repeat bg-orange-200 border border-orange-300 rounded-xl w-5/12 ml-2 p-6"
              style={{
                width: "100%"
              }}
            >
              <p className="text-5xl text-indigo-900">
              Form 5 <br />
              </p>
            </div>
            <div
              className="bg-no-repeat bg-orange-200 border border-orange-300 rounded-xl w-5/12 ml-2 p-6"
              style={{
                width: "100%"
              }}
            >
              <p className="text-5xl text-indigo-900">
              Form 6 <br />
              </p>
            </div>
          </div>
        </div>
      </div>
    </>
  );
};

export default Dashboard;
